export function renderNavItem(item, classNameItem) {
    const classNames = `${classNameItem}-link ${item.class} ${item.active ? 'active' : ''}`;
    return (
        <a className={classNames} href={item.link}>{item.value}</a>
    );
}

export default function NavList({ items, className, renderNavItem }) {
    return (
        <ul className={className}>
            {items.map(item => (
                <li key={item.id}>
                    {renderNavItem(item, className)}
                </li>
            ))}
        </ul>
    )
}
